import React from "react";

class Weather extends React.Component {
  render() {
    return (
      <div>
        { this.props.city && this.props.country && <div className="Location">Location: { this.props.city }, { this.props.country}</div>}
        { this.props.temperature &&<div className="Tempera">Temperature: { this.props.temperature }</div> }
        { this.props.temp_min && <div>Min_Temperature: { this.props.temp_min }</div>}
        { this.props.temp_max && <div>Max_Temperature: { this.props.temp_max }</div> }
        { this.props.description && <div>Weather: { this.props.description }</div> }
      </div>
    )
 }  
}

export default Weather;
